import React from 'react';

import '../card/card.styles.css';

export const BrandCard = props => (
  console.log(props),
  <div className='card-container'>
    <img
      alt='item'
      src={`${props.item.img}`}
    />
    <h2> {props.item.name} </h2>
    <p> {props.item.description} </p>
  </div>
);
